import LoginPage from '../pageobjects/login.page';
import HomePage from '../pageobjects/home.page';

describe('My Login application to Blockchain', () => {
    it('should login with valid credentials to Blockchain login page', () => {
        LoginPage.open();
        LoginPage.login('dde096eb-538c-4097-89cb-67eae53448a0', '61626364');
        expect(HomePage.settingsLink).toBeExisting();
        expect(HomePage.totalBalance).toHaveTextContaining(
            'Total Balance');
    });
});

