import Page from './page';

class LoginPage extends Page {

    get walletId () { return $('//input[@name=\'guidOrEmail\']') }
    get password () { return $('//input[@name=\'password\']') }
    get btnContinue () { return $('button[type="submit"]') }
    get btnLoginWithPassword () { return $('button[data-e2e="loginWithPassword"]') }

    login (username, password) {
        this.walletId.setValue(username);
        this.btnContinue.click();
        this.btnLoginWithPassword.click();
        this.password.setValue(password);
        this.btnContinue.click();
    }

    open () {
        return super.open('login');
    }
}

export default new LoginPage();

